local function getMyId()
    local result, id = sampGetPlayerIdByCharHandle(playerPed)
    if result then 
        return id 
    end 
    return 0
end
local function sampGetPlayerIdByNickname(nick) 
    local result, myid = sampGetPlayerIdByCharHandle(playerPed) 
    if result then 
        if tostring(nick) == sampGetPlayerNickname(myid) then 
            return myid 
        end 
        for i = 0, 1000 do 
            if sampIsPlayerConnected(i) and sampGetPlayerNickname(i) == tostring(nick) then 
                return i 
            end 
        end 
    end
    return -1
end
local function AddChatMessage(text)
	sampAddChatMessage("{5732a8}[AdminTools] {FFFFFF}"..text, 0x5732a8)
end 
local function explode_argb(argb)
    local a = bit.band(bit.rshift(argb, 24), 0xFF)
    local r = bit.band(bit.rshift(argb, 16), 0xFF)
    local g = bit.band(bit.rshift(argb, 8), 0xFF)
    local b = bit.band(argb, 0xFF)
    return a, r, g, b
end
local function createNewJsonTable(table)
	if not doesFileExist(getWorkingDirectory().."\\config\\AdminTools\\"..table[2]..".json") then
