		end
   	else
	   	local f = io.open(getWorkingDirectory().."\\config\\AdminTools\\"..table[2]..".json", "r")
	   	if f then
		 	table[1] = decodeJson(f:read("*a"))
		 	f:close()
	   	end
	end
end
