        end
        if flyStatus and HLcfg.config.adminLVL >= 2 and elements.checkbox.airBrake.v then
            if isCharInAnyCar(playerPed) then heading = getCarHeading(storeCarCharIsInNoSave(playerPed))
            else heading = getCharHeading(playerPed) end
            local camCoordX, camCoordY, camCoordZ = getActiveCameraCoordinates()
            local targetCamX, targetCamY, targetCamZ = getActiveCameraPointAt()
            local angle = getHeadingFromVector2d(targetCamX - camCoordX, targetCamY - camCoordY)
            if isCharInAnyCar(playerPed) then difference = 0.79 else difference = 1.0 end
            setCharCoordinates(playerPed, airBrkCoords[1], airBrkCoords[2], airBrkCoords[3] - difference)
            if not isSampfuncsConsoleActive() and not sampIsChatInputActive() and not sampIsDialogActive() then
                if isKeyDown(VK_W) then
                airBrkCoords[1] = airBrkCoords[1] + HLcfg.config.airSpeed * math.sin(-math.rad(angle))
                airBrkCoords[2] = airBrkCoords[2] + HLcfg.config.airSpeed * math.cos(-math.rad(angle))
                if not isCharInAnyCar(playerPed) then setCharHeading(playerPed, angle)
                else setCarHeading(storeCarCharIsInNoSave(playerPed), angle) end
                elseif isKeyDown(VK_S) then
                    airBrkCoords[1] = airBrkCoords[1] - HLcfg.config.airSpeed * math.sin(-math.rad(heading))
                    airBrkCoords[2] = airBrkCoords[2] - HLcfg.config.airSpeed * math.cos(-math.rad(heading))
                end
                if isKeyDown(VK_A) then
                    airBrkCoords[1] = airBrkCoords[1] - HLcfg.config.airSpeed * math.sin(-math.rad(heading - 90))
                    airBrkCoords[2] = airBrkCoords[2] - HLcfg.config.airSpeed * math.cos(-math.rad(heading - 90))
                elseif isKeyDown(VK_D) then
                    airBrkCoords[1] = airBrkCoords[1] - HLcfg.config.airSpeed * math.sin(-math.rad(heading + 90))
                    airBrkCoords[2] = airBrkCoords[2] - HLcfg.config.airSpeed * math.cos(-math.rad(heading + 90))
                end
                if isKeyDown(VK_SPACE) then airBrkCoords[3] = airBrkCoords[3] + HLcfg.config.airSpeed / 2.0 end
                if isKeyDown(VK_LSHIFT) and airBrkCoords[3] > -95.0 then airBrkCoords[3] = airBrkCoords[3] - HLcfg.config.airSpeed / 2.0 end
                if isKeyJustPressed(VK_OEM_PLUS) then
                    local result = HLcfg.config.airSpeed + elements.slider.airBrakeSpeedDown.v
                    if result <= 60 then 
                        HLcfg.config.airSpeed = HLcfg.config.airSpeed + elements.slider.airBrakeSpeedUp.v
                        printStyledString("Speed increased by "..tostring(string.format("%.2f", elements.slider.airBrakeSpeedUp.v)), 1000, 4)
                        save()
                    else 
                        printStyledString("The speed cannot be greater", 1000, 4)
                        HLcfg.config.airSpeed = 60
                        save()
                    end
                end
                if isKeyJustPressed(VK_OEM_MINUS) then
                    local result = HLcfg.config.airSpeed - elements.slider.airBrakeSpeedDown.v
                    if result > 0 then 
                        HLcfg.config.airSpeed = HLcfg.config.airSpeed - elements.slider.airBrakeSpeedDown.v
                        printStyledString("Speed reduced by "..tostring(string.format("%.2f", elements.slider.airBrakeSpeedDown.v)), 1000, 4) 
                        save()
                    else 
                        printStyledString("The speed cannot be less", 1000, 4)
                        HLcfg.config.airSpeed = 0.2
                        save()
                    end
                end
            end
        end	
        local result, button, list, input = sampHasDialogRespond(3012)
        if result then 
            if button == 1 then 
                lua_thread.create(function()
                    for i = 0, #mpSend do 
                        if list == i then 
