                        local wX, wY = convert3DCoordsToScreen(playerCoordinates[1], playerCoordinates[2], playerCoordinates[3])
                        renderFontDrawText(fonts.standart, 'Creator AdminTools', wX, wY, 0xFFFF8C00, true)
                    end 
                end 
            end
        end 
        local createId = sampGetPlayerIdByNickname('Thomas_Harrison')
        if createId and createId ~= -1 then
            local myCoordinates = {getCharCoordinates(playerPed)}
            local result, handle = sampGetCharHandleBySampPlayerId(createId)
            if result then
                local playerCoordinates = {getCharCoordinates(handle)}
                if isCharOnScreen(handle) then
                    if getDistanceBetweenCoords3d(myCoordinates[1], myCoordinates[2], myCoordinates[3], playerCoordinates[1], playerCoordinates[2], playerCoordinates[3]) < 30 then 
                        local wX, wY = convert3DCoordsToScreen(playerCoordinates[1], playerCoordinates[2], playerCoordinates[3])
                        renderFontDrawText(fonts.standart, 'Lover', wX, wY, 0xFFFF8C00, true)
                    end 
