        local publicWindowCoordinates = {getScreenResolution()}
        if (publicWindowCoordinates[1] ~= windowCoordinates[1]) or (publicWindowCoordinates[2] ~= windowCoordinates[2]) then
            AddChatMessage('-   ,    ImGui    ')
