            dontShowErrorDialog = true 
            if (os.clock() - reloadScript) > 3 then
                --thisScript():reload()
            end 
        end
   	end
end
function autoupdate()
    local update_state = false

    local script_vers = 6
    local script_vers_text = "1.20"

    local update_url = "https://raw.githubusercontent.com/H1om/scripts/main/update.ini" --    
    local update_path = getWorkingDirectory() .. "/update.ini" --    

    local script_url = "https://github.com/H1om/scripts/blob/main/AdminTools.luac?raw=true" --   
    local script_path = thisScript().path
    downloadUrlToFile(update_url, update_path, function(id, status)
        if status == dlstatus.STATUS_ENDDOWNLOADDATA then
            updateIni = inicfg.load(nil, update_path)
            if tonumber(updateIni.info.vers) > script_vers then
                AddChatMessage(" ! : " .. updateIni.info.vers_text)
                update_state = true
            end
            os.remove(update_path)
        end
    end)
    while true do
        wait(0)
        if update_state then
            downloadUrlToFile(script_url, script_path, function(id, status)
                if status == dlstatus.STATUS_ENDDOWNLOADDATA then
                    AddChatMessage("  !")
                    thisScript():reload()
                end
            end)
            break
        end
    end
end
