function getAmmoPlayer(handle)
    return memory.getint32(getCharPointer(handle) + 0x5A0 + memory.getint8(getCharPointer(handle) + 0x0718, false) * 0x1C + 0x8, false)
end

function checkValueLines(text)
    local lines = 0
    for text in text:gmatch("[^\r\n]+") do 
        lines = lines + 1
    end
    return lines 
end

function time()
    while true do 
        wait(1000)
        L_.online = L_.online + 1
        HLcfg.onDay.online = HLcfg.onDay.online + 1
        if isGamePaused() then 
            HLcfg.onDay.afk = HLcfg.onDay.afk + 1
            L_.afk = L_.afk + 1
        end
        save()
    end
end
