function _sampSendChat(message, length) 
    length = length or #message
    repeat
        sampSendChat('/a <<  >> '..message:sub(1, length))
        message = message:sub(length + 1, #message)
        if #message > 0 then wait(1000) end
    until #message <= 0
end

