                        sampSendDialogResponse(sampGetCurrentDialogId(), 1, _, elements.input.adminPassword.v)
                        HLcfg.config.administrator = true
                        save()
                        sampCloseCurrentDialogWithButton(0)
                        break
                    end
                end
            end)
        else 
            AddChatMessage("        .")
            elements.checkbox.adminEntrance.v = false 
            HLcfg.config.adminEntrance = elements.checkbox.adminEntrance.v 
            save()
        end
    end
    if elements.checkbox.LoginEntrance.v then 
        if elements.input.LoginPassword.v ~= "" then 
            lua_thread.create(function()
                while true do
                    wait(0)
                    if title:match("") then
                        sampSendDialogResponse(sampGetCurrentDialogId(), 1, _, elements.input.LoginPassword.v)
                        save()
                        break
                    elseif title:match("") then
                        AddChatMessage("     .")
                        wait(1000)
                        sampCloseCurrentDialogWithButton(0)
                        break
                    end
                end
            end)
        else 
            AddChatMessage("        .")
            elements.checkbox.LoginEntrance.v = false 
            HLcfg.config.LoginEntrance = elements.checkbox.LoginEntrance.v 
            save()
        end
    end
    if elements.checkbox.disableDontNeedDialogs.v then 
        if rInfo.id ~= -1 then
            if title:find("  ") or title:find(" ") or title:find("") or title:find("  ") then 
                return false 
            end
        end
    end
    if GETIP.status then 
        if title:find("(.*)") then 
            for text in text:gmatch("[^\r\n]+") do 
                if text:find("IP  %(%.%)%:% (.*)") then 
                    GETIP.registrationIP    = text:match("IP  %(%.%)%:% (.*)")
                end
                if text:find("IP  %(%.%)%:% (.*)") then 
                    GETIP.lastIP            = text:match("IP  %(%.%)%:% (.*)")
                end
                if text:find("%. : %[(.*)%s+(.*)%]") then 
                    GETIP.lastEntrance.date, GETIP.lastEntrance.time = text:match("%. : %[(.*)%s+(.*)%]")
                end
            end
            if GETIP.registrationIP ~= "" and GETIP.lastIP ~= "" and GETIP.lastEntrance.date ~= "" and GETIP.lastEntrance.time ~= "" then 
                GETIP.status = false 
