function get_clock(time) 
	local timezone_offset = 86400 - os.date('%H', 0) * 3600 
	if tonumber(time) >= 86400 then 
		onDay = true 
	else 
		onDay = false 
	end 
	return os.date((onDay and math.floor(time / 86400)..' ' or '')..'%H:%M:%S', time + timezone_offset) 
end

